import React, { useState, useEffect } from "react";

function MaaS360Data() {
  const [devices, setDevices] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/maas360")
      .then((response) => response.json())
      .then((data) => {
        setDevices(data);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>Device Data</h1>
      {devices.map((device) => (
        <div key={device.id}>
          <p>{device.name}</p>
          <p>{device.os}</p>
          <p>{device.username}</p>
          <p>{device.lastReported}</p>
          <p>{device.deviceStatus}</p>
        </div>
      ))}
    </div>
  );
}

export default MaaS360Data;
